import * as React from "react";
import {iWizardStep} from "../../view-components/wizard/wizard";
import {ReactElement} from "react";
import {toolTipContent} from "../_common/tool-tip-content/content-tool-tips";
import {CatmanIcon} from "../../svg/icons/icons";
import AppButton from "../../view-components/button/app-button";

let element : ReactElement = (
    <div>
        <h3>Automatically Add/Update Products</h3>
        <AppButton
            buttonType={"drag-area-large"}
            buttonLabel=""
            OnClick={()=>this.footerActions("cancel")}
            tooltipType="custom"
            tooltip={toolTipContent.footerCancel()}
            toolTipTimeOutInMS={10000}
            iconLeft={
                <CatmanIcon
                    iconName="cancel"
                    classes=" "
                    height="100%"
                    width="100%"
                />
            }
        />
    </div>
);

export let uploadWizard : iWizardStep[] = [
    {
        titleHeader : "string;",
        instructionText : "string;",
        panel : element,
        winCondition : (1 > 0)
    },
    {
        titleHeader : "string;",
        instructionText : "string;",
        panel : element,
        winCondition : (1 > 0)
    },
    {
        titleHeader : "string;",
        instructionText : "string;",
        panel : element,
        winCondition : (1 > 0)
    }
];
